import{_ as a,c as t,o as p,ap as n}from"./chunks/framework.CvQVt9Yw.js";const h=JSON.parse('{"title":"臻鼎科技集团：深化合作，共谋发展新篇章​","description":"","frontmatter":{"head":[["link",{"rel":"canonical","href":"https://b.14ll.com/changes/57"}],["meta",{"property":"og:title","content":"臻鼎科技集团：深化合作，共谋发展新篇章​"}]]},"headers":[],"relativePath":"changes/57.md","filePath":"changes/57.md"}'),r={name:"changes/57.md"};function o(s,e,c,_,l,i){return p(),t("div",null,e[0]||(e[0]=[n('<h1 id="臻鼎科技集团-深化合作-共谋发展新篇章​" tabindex="-1">臻鼎科技集团：深化合作，共谋发展新篇章​ <a class="header-anchor" href="#臻鼎科技集团-深化合作-共谋发展新篇章​" aria-label="Permalink to &quot;臻鼎科技集团：深化合作，共谋发展新篇章​&quot;">​</a></h1><p>臻鼎科技集团：深化合作，共谋发展新篇章</p><p>2024年10月29日下午，秦皇岛市委书记王曦与臻鼎科技集团董事长沈庆芳举行了工作座谈，双方就进一步深化务实合作、实现共赢发展进行了深入交流。王曦书记对沈庆芳董事长一行的到来表示热烈欢迎，并对臻鼎科技集团长期以来对秦皇岛发展的支持表示衷心感谢。他指出，当前秦皇岛市正深入贯彻落实习近平总书记的重要讲话精神和党的二十届三中全会精神，积极推进数字经济发展，希望与臻鼎科技集团携手，共同抢抓数字经济发展的新机遇，推动双方合作迈上新台阶。</p><p>沈庆芳董事长对秦皇岛市委、市政府一直以来的支持表示感谢，并表示臻鼎科技集团与秦皇岛的合作基础深厚，对未来的合作充满信心。他强调，企业将积极对接秦皇岛的发展战略和需求，利用自身在数智技术方面的优势，为秦皇岛的高质量发展贡献力量。</p><p>臻鼎科技集团作为全球领先的印制电路板（PCB）制造商，近年来在秦皇岛的投资和合作项目取得了显著成果。例如，集团在秦皇岛设立的高端集成电路封装载板智能制造工厂项目，已成为当地电子信息产业的重要组成部分。该项目的建设和投产，不仅提升了秦皇岛在高端制造领域的竞争力，也为当地经济发展注入了新的活力。</p><p>此外，臻鼎科技集团还积极参与地方人才培养和科技合作。2022年11月，沈庆芳董事长一行到桂林电子科技大学南宁研究院考察交流，探讨校企合作模式，旨在培养具备创新精神和实践能力的高素质人才，为产业链的发展提供有力支撑。</p><p>在环保方面，臻鼎科技集团始终坚持绿色发展的理念。沈庆芳董事长曾表示，企业在建设新厂房时，以业界最高规格投资环保，体现了对可持续发展的高度重视。 这一举措不仅提升了企业的社会责任形象，也为地方的生态环境保护作出了积极贡献。</p><p>展望未来，臻鼎科技集团将继续深化与秦皇岛的合作，围绕数字经济、高端制造、人才培养等领域，推动双方合作向更高水平迈进。同时，秦皇岛市委、市政府也将持续优化营商环境，为企业在当地的发展提供优质服务和良好条件，携手开创互利共赢的新局面。</p><p>通过此次座谈，臻鼎科技集团与秦皇岛市进一步明确了合作方向和目标，双方将共同努力，推动合作项目落地生根，为地方经济社会发展和企业自身成长创造更多机遇，实现共同繁荣。</p>',9)]))}const m=a(r,[["render",o]]);export{h as __pageData,m as default};
